description: >-
  Hola hola, nový rok si přináší nové pokusy 🙂. Kdo nic nezkusí, sice nic
  nezkazí, ale také nic nezíská, třebas jen zkušenost (ať jakoukoliv) 🙂

  Lednovou párty přesouváme z výměníku do kavárny FELICIE v Domě Kultury (Mladá Boleslav). 


  Tentokrát si nemusíte nic sebou brát, jídlo, pití na místě 🙂 Parket menší, ale když to bude mít úspěch, pořídíme lino a parket rozšíříme 🙂 Těšíme se na vaše názory, přijďte to odzkoušet a dejte nám vědět.

  Celý večer nám hudbu bude pouštět báječný DJ Lole.


  Vstup 100 Kč.


  Těšíme se na vás, vaše Familia.


  p.s. Před párty je celý den bachata workshop (dopoledne Ladies styling s Jolly a odpoledne párová bachata s Emilsonem).
